import React from 'react' 
import { FaGithub, FaRegEnvelope, FaLinkedinIn, FaDownload } from "react-icons/fa"; 
import "./styles/Footer.css";

const Footer = () => {
   return (
        <div className="profile-footer">
            <div className="profile-footer-links">
                <a href="https://github.com/tiffcrockett"><FaGithub size="1.25em" color="white" />&nbsp;&nbsp;</a>
                <a href="mailto:crockett.tiff@gmail.com" target="_blank"><FaRegEnvelope size="1.25em" color="white" />&nbsp;&nbsp;</a>
                <a href="https://www.linkedin.com/in/tiffany-crockett-3217831a2/"><FaLinkedinIn size="1.25em" color="white"/>&nbsp;&nbsp;</a>
                <a href="https://drive.google.com/file/d/1FydvLQVSJncBN7Ru4fXlJLrAzuYzOPDJ/view?usp=sharing" target="_blank"><FaDownload size="1.25em" color="white" /></a>
            </div>
        </div>
      )
  }
  
export default Footer;
